export const getNotesFromDB = () => {
  const notes = [
    {note: "Primera nota de mock"},
    {note: "Segunda nota de mock"},
    {note: "Tercera nota de mock"},
    {note: "Cuarta nota de mock"},
    {note: "Quinta nota de mock"}
  ]
  return notes;
}
